
CREATE TABLE IF NOT EXISTS countries_continents (
    id SERIAL PRIMARY KEY,
    entity TEXT NOT NULL,
    tipo INTEGER NOT NULL
);


CREATE TABLE IF NOT EXISTS energy_data (
    id INTEGER REFERENCES countries_continents(id),
    Entity TEXT NOT NULL,
    Code TEXT,
    Year INTEGER NOT NULL,
    Solar_capacity REAL,
    Biofuels_production_TWh REAL,
    Electricity_solar_TWh REAL,
    Electricity_wind_TWh REAL,
    Electricity_hydro_TWh REAL,
    Renewables_percentage REAL,
    PRIMARY KEY (id, Year)
);


















































































































































































































































































































































































































































































































































